import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import "../commons/Ownable.sol";
import "../commons/Pausable.sol";
import "../commons/ContextMixin.sol";
import "../commons/NativeMetaTransaction.sol";
import "../interfaces/IERC721Verifiable.sol";
import "../interfaces/IRoyaltiesManager.sol";


interface IWenTradePool {
function ethToWenETH(uint256 inputETH) external view returns (uint256);
}

interface IBlast {
  function configureClaimableGas() external;
  function configureGovernor(address governor) external;
}

contract WenExchangeV1 is Ownable, Pausable, NativeMetaTransaction {
  using Address for address;

  IERC20 public acceptedToken;
  IWenTradePool public wenTradePool;
  /// @notice Blast Contract
  IBlast public blast;

  struct Order {
    // Order ID
    bytes32 id;
    // Owner of the NFT
    address seller;
    // NFT registry address
    address nftAddress;
    // Price (in wei) for the published item
    uint256 price;
    // Time when this sale ends
    uint256 expiresAt;
  }

  struct CollectionOrder {
    uint256 tokenId;
    uint256 price;
}

  // From ERC721 registry assetId to Order (to avoid asset collision)
  mapping (address => mapping(uint256 => Order)) public orderByAssetId;

  address public feesCollector;
  IRoyaltiesManager public royaltiesManager;

  uint256 public feesCollectorCutPerMillion;
  uint256 public royaltiesCutPerMillion;
  uint256 public publicationFeeInWei;


  bytes4 public constant InterfaceId_ValidateFingerprint = bytes4(
    keccak256("verifyFingerprint(uint256,bytes)")
  );

  bytes4 public constant ERC721_Interface = bytes4(0x80ac58cd);
  mapping(address => CollectionOrder[]) public ordersByCollection;

  // EVENTS
  event OrderCreated(
    bytes32 id,
    uint256 indexed assetId,
    address indexed seller,
    address nftAddress,
    uint256 priceInWei,
    uint256 expiresAt
  );
  event OrderSuccessful(
    bytes32 id,
    uint256 indexed assetId,
    address indexed seller,
    address nftAddress,
    uint256 priceInEth,
    uint256 priceInWenETH,
    address indexed buyer
  );
  event OrderCancelled(
    bytes32 id,
    uint256 indexed assetId,
    address indexed seller,
    address nftAddress
  );

  event ChangedPublicationFee(uint256 publicationFee);
  event ChangedFeesCollectorCutPerMillion(uint256 feesCollectorCutPerMillion);
  event ChangedRoyaltiesCutPerMillion(uint256 royaltiesCutPerMillion);
  event FeesCollectorSet(address indexed oldFeesCollector, address indexed newFeesCollector);
  event RoyaltiesManagerSet(IRoyaltiesManager indexed oldRoyaltiesManager, IRoyaltiesManager indexed newRoyaltiesManager);


  /**
    * @dev Initialize this contract. Acts as a constructor
    * @param _owner - owner
    * @param _feesCollector - fees collector
    * @param _acceptedToken - Address of the ERC20 accepted for this marketplace
    * @param _royaltiesManager - Royalties manager contract
    * @param _feesCollectorCutPerMillion - fees collector cut per million
    * @param _royaltiesCutPerMillion - royalties cut per million
    */
  constructor (
    address _owner,
    address _feesCollector,
    address _acceptedToken,
    IRoyaltiesManager _royaltiesManager,
    uint256 _feesCollectorCutPerMillion,
    uint256 _royaltiesCutPerMillion,
    IWenTradePool _wenTradePool,
    IBlast _blast
  )  {
    // EIP712 init
    _initializeEIP712('Decentraland Marketplace', '2');

    // Address init
    setFeesCollector(_feesCollector);
    setRoyaltiesManager(_royaltiesManager);

    // Fee init
    setFeesCollectorCutPerMillion(_feesCollectorCutPerMillion);
    setRoyaltiesCutPerMillion(_royaltiesCutPerMillion);

    require(_owner != address(0), "MarketplaceV2#constructor: INVALID_OWNER");
    transferOwnership(_owner);

    require(_acceptedToken.isContract(), "MarketplaceV2#constructor: INVALID_ACCEPTED_TOKEN");
    acceptedToken = IERC20(_acceptedToken);

    wenTradePool = IWenTradePool(_wenTradePool);

    // Set Gas to be claimable 
    blast = IBlast(_blast);
    blast.configureClaimableGas();
  }

  /**
    @notice Set blast governor which is approved for cliaming gas fees. 
    @param _governor governor address
  */

  function setBlastGovernor(address _governor) external onlyOwner {
    blast.configureGovernor(_governor);
  }

  /**
    * @dev Sets the publication fee that's charged to users to publish items
    * @param _publicationFee - Fee amount in wei this contract charges to publish an item
    */
  function setPublicationFee(uint256 _publicationFee) external onlyOwner {
    publicationFeeInWei = _publicationFee;
    emit ChangedPublicationFee(publicationFeeInWei);
  }

  /**
    * @dev Sets the share cut for the fees collector of the contract that's
    *  charged to the seller on a successful sale
    * @param _feesCollectorCutPerMillion - fees for the collector
    */
  function setFeesCollectorCutPerMillion(uint256 _feesCollectorCutPerMillion) public onlyOwner {
    feesCollectorCutPerMillion = _feesCollectorCutPerMillion;

    require(
      feesCollectorCutPerMillion + royaltiesCutPerMillion < 1000000,
      "MarketplaceV2#setFeesCollectorCutPerMillion: TOTAL_FEES_MUST_BE_BETWEEN_0_AND_999999"
    );

    emit ChangedFeesCollectorCutPerMillion(feesCollectorCutPerMillion);
  }

  /**
    * @dev Sets the share cut for the royalties that's
    *  charged to the seller on a successful sale
    * @param _royaltiesCutPerMillion - fees for royalties
    */
  function setRoyaltiesCutPerMillion(uint256 _royaltiesCutPerMillion) public onlyOwner {
    royaltiesCutPerMillion = _royaltiesCutPerMillion;

    require(
      feesCollectorCutPerMillion + royaltiesCutPerMillion < 1000000,
      "MarketplaceV2#setRoyaltiesCutPerMillion: TOTAL_FEES_MUST_BE_BETWEEN_0_AND_999999"
    );

    emit ChangedRoyaltiesCutPerMillion(royaltiesCutPerMillion);
  }

  /**
  * @notice Set the fees collector
  * @param _newFeesCollector - fees collector
  */
  function setFeesCollector(address _newFeesCollector) onlyOwner public {
      require(_newFeesCollector != address(0), "MarketplaceV2#setFeesCollector: INVALID_FEES_COLLECTOR");

      emit FeesCollectorSet(feesCollector, _newFeesCollector);
      feesCollector = _newFeesCollector;
  }

     /**
  * @notice Set the royalties manager
  * @param _newRoyaltiesManager - royalties manager
  */
  function setRoyaltiesManager(IRoyaltiesManager _newRoyaltiesManager) onlyOwner public {
      require(address(_newRoyaltiesManager).isContract(), "MarketplaceV2#setRoyaltiesManager: INVALID_ROYALTIES_MANAGER");


      emit RoyaltiesManagerSet(royaltiesManager, _newRoyaltiesManager);
      royaltiesManager = _newRoyaltiesManager;
  }


  /**
    * @dev Creates a new order
    * @param nftAddress - Non fungible registry address
    * @param assetId - ID of the published NFT
    * @param priceInWei - Price in Wei for the supported coin
    * @param expiresAt - Duration of the order (in hours)
    */
  function createOrder(
    address nftAddress,
    uint256 assetId,
    uint256 priceInWei,
    uint256 expiresAt
  )
    public
    whenNotPaused
  {
    _createOrder(
      nftAddress,
      assetId,
      priceInWei,
      expiresAt
    );
  }

  /**
    * @dev Cancel an already published order
    *  can only be canceled by seller or the contract owner
    * @param nftAddress - Address of the NFT registry
    * @param assetId - ID of the published NFT
    */
  function cancelOrder(address nftAddress, uint256 assetId) public whenNotPaused {
    _cancelOrder(nftAddress, assetId);
  }

  /**
    * @dev Executes the sale for a published NFT and checks for the asset fingerprint
    * @param nftAddress - Address of the NFT registry
    * @param assetId - ID of the published NFT
    * @param price - Order price
    * @param fingerprint - Verification info for the asset
    */
  function safeExecuteOrder(
    address nftAddress,
    uint256 assetId,
    uint256 price,
    bytes memory fingerprint
  )
   public
   whenNotPaused
  {
    _executeOrder(
      nftAddress,
      assetId,
      price,
      fingerprint
    );
  }

  /**
    * @dev Executes the sale for a published NFT
    * @param nftAddress - Address of the NFT registry
    * @param assetId - ID of the published NFT
    * @param price - Order price
    */
  function executeOrder(
    address nftAddress,
    uint256 assetId,
    uint256 price
  )
   public
   whenNotPaused
  {
    _executeOrder(
      nftAddress,
      assetId,
      price,
      ""
    );
  }

  /**
    * @dev Creates a new order
    * @param nftAddress - Non fungible registry address
    * @param assetId - ID of the published NFT
    * @param priceInWei - Price in Wei for the supported coin
    * @param expiresAt - Duration of the order (in hours)
    */
  function _createOrder(
    address nftAddress,
    uint256 assetId,
    uint256 priceInWei,
    uint256 expiresAt
  )
    internal
  {
    _requireERC721(nftAddress);

    address sender = _msgSender();

    IERC721Verifiable nftRegistry = IERC721Verifiable(nftAddress);
    address assetOwner = nftRegistry.ownerOf(assetId);

    require(sender == assetOwner, "MarketplaceV2#_createOrder: NOT_ASSET_OWNER");
    require(
      nftRegistry.getApproved(assetId) == address(this) || nftRegistry.isApprovedForAll(assetOwner, address(this)),
      "The contract is not authorized to manage the asset"
    );
    require(priceInWei > 0, "Price should be bigger than 0");
    require(expiresAt > block.timestamp + 1 minutes, "MarketplaceV2#_createOrder: INVALID_EXPIRES_AT");

    bytes32 orderId = keccak256(
      abi.encodePacked(
        block.timestamp,
        assetOwner,
        assetId,
        nftAddress,
        priceInWei
      )
    );

    CollectionOrder memory newOrder = CollectionOrder({
        tokenId: assetId,
        price: priceInWei
    });
    ordersByCollection[nftAddress].push(newOrder);

    orderByAssetId[nftAddress][assetId] = Order({
      id: orderId,
      seller: assetOwner,
      nftAddress: nftAddress,
      price: priceInWei,
      expiresAt: expiresAt
    });

    // Check if there's a publication fee and
    // transfer the amount to marketplace owner
    if (publicationFeeInWei > 0) {
      require(
        acceptedToken.transferFrom(sender, feesCollector, publicationFeeInWei),
        "MarketplaceV2#_createOrder: TRANSFER_FAILED"
      );
    }

    emit OrderCreated(
      orderId,
      assetId,
      assetOwner,
      nftAddress,
      priceInWei,
      expiresAt
    );
  }

  /**
    * @dev Cancel an already published order
    *  can only be canceled by seller or the contract owner
    * @param nftAddress - Address of the NFT registry
    * @param assetId - ID of the published NFT
    */
  function _cancelOrder(address nftAddress, uint256 assetId) internal returns (Order memory) {
    address sender = _msgSender();
    Order memory order = orderByAssetId[nftAddress][assetId];

    require(order.id != 0, "MarketplaceV2#_cancelOrder: INVALID_ORDER");
    require(order.seller == sender || sender == owner(), "MarketplaceV2#_cancelOrder: UNAUTHORIZED_USER");

    bytes32 orderId = order.id;
    address orderSeller = order.seller;
    address orderNftAddress = order.nftAddress;
    delete orderByAssetId[nftAddress][assetId];

    uint256 index = _findOrderIndex(nftAddress, assetId);
    require(index != type(uint256).max , "Order does not exist");

    ordersByCollection[nftAddress][index] = ordersByCollection[nftAddress][ordersByCollection[nftAddress].length - 1];
    ordersByCollection[nftAddress].pop();

    emit OrderCancelled(
      orderId,
      assetId,
      orderSeller,
      orderNftAddress
    );

    return order;
  }

  /**
    * @dev Executes the sale for a published NFT
    * @param nftAddress - Address of the NFT registry
    * @param assetId - ID of the published NFT
    * @param price - Order price
    * @param fingerprint - Verification info for the asset
    */
  function _executeOrder(
    address nftAddress,
    uint256 assetId,
    uint256 price,
    bytes memory fingerprint
  )
   internal returns (Order memory)
  {
    _requireERC721(nftAddress); 

    address sender = _msgSender();

    IERC721Verifiable nftRegistry = IERC721Verifiable(nftAddress);

    if (nftRegistry.supportsInterface(InterfaceId_ValidateFingerprint)) {
      require(
        nftRegistry.verifyFingerprint(assetId, fingerprint),
        "MarketplaceV2#_executeOrder: INVALID_FINGERPRINT"
      );
    }
    Order memory order = orderByAssetId[nftAddress][assetId];

    require(order.id != 0, "MarketplaceV2#_executeOrder: ASSET_NOT_FOR_SALE");

    require(order.seller != address(0), "MarketplaceV2#_executeOrder: INVALID_SELLER");
    require(order.seller != sender, "MarketplaceV2#_executeOrder: SENDER_IS_SELLER");
    require(order.price == price, "MarketplaceV2#_executeOrder: PRICE_MISMATCH");
    require(block.timestamp < order.expiresAt, "MarketplaceV2#_executeOrder: ORDER_EXPIRED");
    require(order.seller == nftRegistry.ownerOf(assetId), "MarketplaceV2#_executeOrder: SELLER_NOT_OWNER");

    delete orderByAssetId[nftAddress][assetId];

    ordersByCollection[nftAddress][assetId] = ordersByCollection[nftAddress][ordersByCollection[nftAddress].length - 1];
    ordersByCollection[nftAddress].pop();

    uint256 feesCollectorShareAmount;
    uint256 royaltiesShareAmount;
    address royaltiesReceiver;

    uint256 wenETHAmount = wenTradePool.ethToWenETH(price);

    // Royalties share
    if (royaltiesCutPerMillion > 0) {
      royaltiesShareAmount = (wenETHAmount * royaltiesCutPerMillion) / 1000000;

      (bool success, bytes memory res) = address(royaltiesManager).staticcall(
        abi.encodeWithSelector(
            royaltiesManager.getRoyaltiesReceiver.selector,
            address(nftRegistry),
            assetId
        )
      );

      if (success) {
        (royaltiesReceiver) = abi.decode(res, (address));
        if (royaltiesReceiver != address(0)) {
          require(
            acceptedToken.transferFrom(sender, royaltiesReceiver, royaltiesShareAmount),
            "MarketplaceV2#_executeOrder: TRANSFER_FEES_TO_ROYALTIES_RECEIVER_FAILED"
          );
        }
      }
    }

    // Fees collector share
    {
      feesCollectorShareAmount = (wenETHAmount * feesCollectorCutPerMillion) / 1000000;
      uint256 totalFeeCollectorShareAmount = feesCollectorShareAmount;

      if (royaltiesShareAmount > 0 && royaltiesReceiver == address(0)) {
        totalFeeCollectorShareAmount += royaltiesShareAmount;
      }

      if (totalFeeCollectorShareAmount > 0) {
        require(
          acceptedToken.transferFrom(sender, feesCollector, totalFeeCollectorShareAmount),
          "MarketplaceV2#_executeOrder: TRANSFER_FEES_TO_FEES_COLLECTOR_FAILED"
        );
      }
    }

    // Transfer sale amount to seller
    require(
      acceptedToken.transferFrom(sender, order.seller, wenETHAmount - royaltiesShareAmount - feesCollectorShareAmount),
      "MarketplaceV2#_executeOrder: TRANSFER_AMOUNT_TO_SELLER_FAILED"
    );

    // Transfer asset owner
    nftRegistry.safeTransferFrom(
      order.seller,
      sender,
      assetId
    );

    // emit OrderSuccessful(
    //   order.id,
    //   assetId,
    //   order.seller,
    //   nftAddress,
    //   price,
    //   wenETHAmount,
    //   sender
    // );

    return order;
  }

function _findOrderIndex(address nftAddress, uint256 tokenId) private view returns (uint256) {
    for (uint256 i = 0; i < ordersByCollection[nftAddress].length; i++) {
        if (ordersByCollection[nftAddress][i].tokenId == tokenId) {
            return i;
        }
    }
    return type(uint256).max; 
}
  function _requireERC721(address nftAddress) internal view {
    require(nftAddress.isContract(), "MarketplaceV2#_requireERC721: INVALID_NFT_ADDRESS");

    IERC721 nftRegistry = IERC721(nftAddress);
    require(
      nftRegistry.supportsInterface(ERC721_Interface),
      "MarketplaceV2#_requireERC721: INVALID_ERC721_IMPLEMENTATION"
    );
  }

  function getOrdersByCollection(address nftAddress) public view returns (uint256[] memory, uint256[] memory) {
    CollectionOrder[] memory collectionOrders = ordersByCollection[nftAddress];
    uint256[] memory tokenIds = new uint256[](collectionOrders.length);
    uint256[] memory prices = new uint256[](collectionOrders.length);

    for (uint256 i = 0; i < collectionOrders.length; i++) {
        tokenIds[i] = collectionOrders[i].tokenId;
        prices[i] = collectionOrders[i].price;
    }

    return (tokenIds, prices);
}

}

contracts/WenCore/WenGasStation/WenGasSt.content:
//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";

import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/utils/SafeERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";

interface IBlast {
    // base configuration options
    function configureClaimableYield() external;

    function configureClaimableYieldOnBehalf(address contractAddress) external;

    function configureAutomaticYield() external;

    function configureAutomaticYieldOnBehalf(address contractAddress) external;

    function configureVoidYield() external;

    function configureVoidYieldOnBehalf(address contractAddress) external;

    function configureClaimableGas() external;

    function configureClaimableGasOnBehalf(address contractAddress) external;

    function configureVoidGas() external;

    function configureVoidGasOnBehalf(address contractAddress) external;

    function configureGovernor(address _governor) external;

    function configureGovernorOnBehalf(
        address _newGovernor,
        address contractAddress
    ) external;

    // claim yield
    function claimYield(
        address contractAddress,
        address recipientOfYield,
        uint256 amount
    ) external returns (uint256);

    function claimAllYield(
        address contractAddress,
        address recipientOfYield
    ) external returns (uint256);

    // claim gas
    function claimAllGas(
        address contractAddress,
        address recipientOfGas
    ) external returns (uint256);

    function claimGasAtMinClaimRate(
        address contractAddress,
        address recipientOfGas,
        uint256 minClaimRateBips
    ) external returns (uint256);

    function claimMaxGas(
        address contractAddress,
        address recipientOfGas
    ) external returns (uint256);

    function claimGas(
        address contractAddress,
        address recipientOfGas,
        uint256 gasToClaim,
        uint256 gasSecondsToConsume
    ) external returns (uint256);

    // read functions
    function readClaimableYield(
        address contractAddress
    ) external view returns (uint256);

    function readYieldConfiguration(
        address contractAddress
    ) external view returns (uint8);
}

contract WenGasStationV1 is
    Initializable,
    UUPSUpgradeable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable,
    PausableUpgradeable
{
    using SafeERC20Upgradeable for IERC20Upgradeable;

    struct FeeReceiverContract {
        address receiver;
        uint256 percent;
    }

    struct FeeGiverContract {
        address giver;
    }

    /* ========== STATE VARIABLES ========== */

    /// @notice Blast Contract
    IBlast public blast;

    /// @notice Fee Receiver contract list.
    FeeReceiverContract[] public feeReceivers;

    /// @notice Fee giver contract list. (Contracts where fees are collected.)
    FeeGiverContract[] public feeGivers;

    /// @notice Operators that collect and distribute fees.
    mapping(address => bool) public operators;

    event FeesReceived(uint256 amount);
    event FeesDistributed(address contractAddress, uint256 amount);
    event FeesCollected(address contractAddress, uint256 amount);
    event YieldClaimed(address contractAddress, address receipient, uint256 amount);

    /* ========== Restricted Function  ========== */

    function setInitialInfo(address _blast) external onlyOwner {
        blast = IBlast(_blast);
        blast.configureClaimableYield();
        blast.configureClaimableGas();
    }

    /**
        @notice Set Blast address
     */
    function setBlast(address _blast) external onlyOwner {
        blast = IBlast(_blast);
    }

    /**
        @notice Initialize UUPS upgradeable smart contract.
     */
    function initialize() external initializer {
        __Ownable_init();
        __ReentrancyGuard_init();
        __Pausable_init();
    }

    /**
    @notice Set blast governor which is approved for cliaming gas fees. 
    @param _governor governor address
     */
    function setBlastGovernor(address _governor) external onlyOwner {
        blast.configureGovernor(_governor);
    }

    /**
     /**
        @notice Claim Yield for specific amount. 
     */
    function claimYield(
        address recipient,
        uint256 amount
    ) external onlyOperator {
        uint256 yield = blast.claimYield(address(this), recipient, amount);
        emit FeesReceived(yield);
    }

    /**
        @notice Claim all yields. This will be called by operator regularly.
     */
    function claimAllYield(address recipient) external onlyOperator {
        require(operators[msg.sender], "Not a operators");
        uint256 yield = blast.claimAllYield(address(this), recipient);
        emit FeesReceived(yield);
    }

    /**
        @notice restrict upgrade to only owner.
     */
    function _authorizeUpgrade(
        address newImplementation
    ) internal virtual override onlyOwner {}

    /**
        @notice pause contract functions.
     */
    function pause() external onlyOwner whenNotPaused {
        _pause();
    }

    /**
        @notice unpause contract functions.
     */
    function unpause() external onlyOwner whenPaused {
        _unpause();
    }

    /**
    @notice Approve contracts to mint and renounce ownership
    @dev In production the only minters should be `SIGFarm`
             Addresses are given via dynamic array to allow extra minters during testing
     */
    function setOperator(address[] calldata _operators) external onlyOwner {
        for (uint256 i = 0; i < _operators.length; i++) {
            operators[_operators[i]] = true;
        }
    }

    /**
     @notice Revoke authority to mint and burn the given token.
     */
    function revokeOperator(address _operator) external onlyOwner {
        require(operators[_operator], "This address is not an operator");
        operators[_operator] = false;
    }

    /**
     @notice Add Fee Receiver Contract
     */
    function addFeeReceiver(
        address _receiver,
        uint256 _percent
    ) external onlyOwner {
        require(_receiver != address(0), "Invalid receiver address");
        feeReceivers.push(FeeReceiverContract(_receiver, _percent));
    }

    /**
     @notice Remove Fee Receiver Contract
     */
    function removeFeeReceiver(address _receiver) external onlyOwner {
        uint256 index = findFeeReceiverIndex(_receiver);
        require(index != type(uint256).max, "Receiver not found");

        feeReceivers[index] = feeReceivers[feeReceivers.length - 1];
        feeReceivers.pop();
    }

    /**
     @notice Add Fee Giver Contract
     */
    function addFeeGiver(address _giver) external onlyOwner {
        require(_giver != address(0), "Invalid giver address");
        feeGivers.push(FeeGiverContract(_giver));
    }

    /**
     @notice Remove Fee Giver Contract
     */
    function removeFeeGiver(address _giver) external onlyOwner {
        uint256 index = findFeeGiverIndex(_giver);
        require(index != type(uint256).max, "Giver not found");

        feeGivers[index] = feeGivers[feeGivers.length - 1];
        feeGivers.pop();
    }


    /**
     * @notice Claim All Gas Fees From Blast
     * @notice To claim all of your contract’s gas fees, regardless of your resulting claim rate.
     */
    function claimAll() external onlyOperator {
        for (uint256 i = 0; i < feeGivers.length; i++) {
            FeeGiverContract memory giver = feeGivers[i];
            uint256 feeAmount = blast.claimAllGas(giver.giver, address(this));
            emit FeesCollected(giver.giver, feeAmount);
        }
    }

    /**
     * @notice Claim All Gas Fee From Blast By Contract
     * @notice To claim all of your contract’s gas fees, regardless of your resulting claim rate.
     */
    function claimAllByContract(address addr) external onlyOperator {
        uint256 feeAmount = blast.claimAllGas(addr, address(this));
        emit FeesCollected(addr, feeAmount);
    }

    /**
     * @notice Claim Max Gas From Blast
     * @notice You can use claimMaxGas to guarantee a 100% claim rate
     */
    function claimMax() external onlyOperator {
        for (uint256 i = 0; i < feeGivers.length; i++) {
            FeeGiverContract memory giver = feeGivers[i];
            uint256 feeAmount = blast.claimMaxGas(giver.giver, address(this));
            emit FeesCollected(giver.giver, feeAmount);
        }
    }

    /**
     * @notice Claim Max Gas Fee From Blast By Contract
     * @notice You can use claimMaxGas to guarantee a 100% claim rate
     */
    function claimMaxByContract(address addr) external onlyOperator {
        uint256 feeAmount = blast.claimMaxGas(addr, address(this));
        emit FeesCollected(addr, feeAmount);
    }

    /**
     * @notice Claim Gas At Min From Blast
     * @param minClaimRateBips If you want minimum 80% claim rate, that translates to 8000 bips.
     */
    function claimGasAtMinClaimRate(
        uint256 minClaimRateBips
    ) external onlyOperator {
        for (uint256 i = 0; i < feeGivers.length; i++) {
            FeeGiverContract memory giver = feeGivers[i];
            uint256 feeAmount = blast.claimGasAtMinClaimRate(
                giver.giver,
                address(this),
                minClaimRateBips
            );
            emit FeesCollected(giver.giver, feeAmount);
        }
    }

    /**
     * @notice Claim Gas At Min From Blast
     * @param minClaimRateBips If you want minimum 80% claim rate, that translates to 8000 bips.
     */
    function claimGasAtMinClaimRateByContract(
        address addr,
        uint256 minClaimRateBips
    ) external onlyOperator {
        uint256 feeAmount = blast.claimGasAtMinClaimRate(
            addr,
            address(this),
            minClaimRateBips
        );
        emit FeesCollected(addr, feeAmount);
    }

   /**
     * @notice Distribute Fees
     */
    function distributeFees() external onlyOperator {
        require(address(this).balance > 0, "No Eth to distribute.");
        uint256 totalBalance = address(this).balance;

        // Calculate the total percentage sum of all fee receivers
        uint256 totalPercent = 0;
        for (uint256 i = 0; i < feeReceivers.length; i++) {
            totalPercent += feeReceivers[i].percent;
        }
        require(totalPercent > 0, "Total percent should be more than 0");

        // Distribute the balance according to each receiver's percentage
        for (uint256 i = 0; i < feeReceivers.length; i++) {
            FeeReceiverContract memory receiver = feeReceivers[i];
            uint256 amount = ((totalBalance * receiver.percent*1e10) / totalPercent)/1e10;
            payable(receiver.receiver).call{value:amount}("");
            emit FeesDistributed(receiver.receiver, amount);
        }
    }
    function changePercentage(
        address contractAddr,
        uint256 newPercentage
    ) external onlyOwner {
        uint256 index = findFeeReceiverIndex(contractAddr);
        require(index != type(uint256).max, "Receiver not found");
        require(newPercentage > 0, "New Percentage should be bigger than 0");
        feeReceivers[index].percent = newPercentage;
    }

     /**
        @notice Claim Yield for specific amount. 
        @notice Claim Yield which gas station has been set as governor. 
     */
    function claimYield(address contractAddress, address recipient, uint256 amount) external onlyOperator{
        uint256 yield = blast.claimYield(contractAddress, recipient, amount);
        emit YieldClaimed(contractAddress, recipient, yield);
    }

    /**
        @notice Claim all yields. This will be called by operator regularly.
     */
    function claimAllYield(address contractAddress, address recipient) external onlyOperator {
        require(operators[msg.sender], "Not a operators");
        uint256 yield = blast.claimAllYield(contractAddress, recipient);
        emit YieldClaimed(contractAddress, recipient, yield);
    }

    /* ========== External Function  ========== */

    /* ========== Internal Function  ========== */

    function findFeeReceiverIndex(
        address _receiver
    ) internal view returns (uint256) {
        for (uint256 i = 0; i < feeReceivers.length; i++) {
            if (feeReceivers[i].receiver == _receiver) {
                return i;
            }
        }
        return type(uint256).max; // Receiver not found
    }

    function findFeeGiverIndex(address _giver) internal view returns (uint256) {
        for (uint256 i = 0; i < feeGivers.length; i++) {
            if (feeGivers[i].giver == _giver) {
                return i;
            }
        }
        return type(uint256).max; // Receiver not found
    }

    receive() external payable {}

    fallback() external payable {}

    /* ========== Modifier  ========== */
    modifier onlyOperator() {
        require(operators[msg.sender], "Not a operators");
        _;
    }
}

